import React, { useState, useEffect } from 'react';
import bridge from '@vkontakte/vk-bridge';
import { View, ScreenSpinner, AdaptivityProvider, AppRoot, ConfigProvider, SplitLayout, SplitCol } from '@vkontakte/vkui';
import '@vkontakte/vkui/dist/vkui.css';

import Home from './panels/Home';
import Persik from './panels/Persik';
import NewPage from './panels/NewPage';
import Modal from './panels/Modal';
import Share from './panels/Share';
import async from "async"; // Замените на путь к вашему компоненту "Поделиться"



const App = () => {
	const [activePanel, setActivePanel] = useState('home');
	const [fetchedUser, setUser] = useState(null);
	const [popout, setPopout] = useState(<ScreenSpinner size='large' />);

	useEffect(() => {
		async function fetchData() {
			const user = await bridge.send('VKWebAppGetUserInfo');
			setUser(user);
			setPopout(null);
		}
		fetchData();



		bridge.send('VKWebAppShowSlidesSheet', {
			slides: [
				{
					media: {
						blob: 'data:image/png;base64,',
						type: 'image'
					},
					title: 'Заголовок слайда',
					subtitle: 'Описание слайда под заголовком'
				},
				{
					media: {
						blob: 'data:image/jpeg;base64,',
						type: 'image'
					},
					title: 'Заголовок слайда №2',
					subtitle: 'Описание слайда под заголовком №2'
				},
			]})
			.then((data) => {
				if (data.result) {
					// Слайды показаны
				}
			})
			.catch((error) => {
				// Ошибка
				console.log(error);
			});

	}, []);
	useEffect(() => {
		async function fetchTokenData(){
			const token = await bridge.send('VKWebAppGetAuthToken', {
				app_id: 51766180,
				scope: 'friends,status',
			});

			const friends = await bridge.send('VKWebAppCallAPIMethod', {
				method: 'friends.get',
				params: {
					order:'random',
					fields:'bdate, can_post, photo_100',
					v: '5.131',
					access_token: token.access_token
				}});


			console.log(friends)
		}
		fetchTokenData();
	}, []);


	const go = e => {
		setActivePanel(e.currentTarget.dataset.to);
	};


	return (
		<ConfigProvider>
			<AdaptivityProvider>
				<AppRoot >
					<SplitLayout popout={popout}>
						<SplitCol>
							<View activePanel={activePanel} >
								<Home id='home' fetchedUser={fetchedUser} go={go} />
								<Persik id='persik' go={go} />
								<NewPage id='new_page' go={go} />
								<Modal id='modal' go={go} />
								<Share id="share" go={go} />
							</View>
						</SplitCol>
					</SplitLayout>
				</AppRoot>
			</AdaptivityProvider>
		</ConfigProvider>
	);
}

export default App;
